import React, { Component } from 'react';
import '../stylesheets/App.css';
import {ProgressBar, Container, Col, Row, Navbar, Nav, NavDropdown, Form, FormControl, Button, Carousel, Table, Jumbotron } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import Footer from "./Footer";
import NavHeader from "./NavHeader";

function ProjectJumbo(props) {
    return (
        <Jumbotron className = "projectJumbo">
            <h1>TEST</h1>
        </Jumbotron>
    );
}

function ProjectSummary(props) {
    return (
        <Jumbotron className="projectSummary">
            <ProgressBar variant="success" class="projectProgress" animated now={50} />

        </Jumbotron>
    );
}

function ProjectTitle(props) {
    return (
        <Jumbotron className="projectTitle">
        </Jumbotron>
    );
}

class ProjectDashboard extends Component {
    render() {
        return (
            <div className="ProjectDashboard">
                <NavHeader />
                <Table>
                    <Row>
                        <Col xs={6}>
                        <ProjectJumbo/> (wider)
                        </Col>
                        <Col>
                        <ProjectSummary/>
                        </Col>
                    </Row>
                </Table>
                <Footer />
                </div>
        );
    }
}

export default ProjectDashboard;
